    var margin = {
            width = 1000,
            height = 500;

    d3.select("body").append("h1")
            .attr('width', width)
            .attr('height', height)
            .text('Households with Hedgehogs as Pets');

    var projection = d3.geo.albers();

    var color_scale1 = d3.scale.quantize()
            .domain(d3.values(state_data[0]))
            .range(["#bae4bc","#7bccc4","#43a2ca","#0868ac"]);

    var color_scale2 = d3.scale.quantize()
            .domain(d3.values(counties_data[0]))
            .range(['#543005','#8c510a','#bf812d','#dfc27d','#f6e8c3','#f5f5f5','#c7eae5','#80cdc1','#35978f','#01665e','#003c30']);

    var path = d3.geo.path()
            .projection(projection)
            .pointRadius(function(d){return Math.floor(d[1]/14);});

    var svg = d3.select("body").append("svg")
            .attr('width', width)
            .attr('height', height);

    queue()
            .defer(d3.json, "us.json")
            .await(ready);

    function ready(error, us) {
        svg.append("path")
                .datum(topojson.feature(us, us.objects.land))
                .attr("class", "land")
                .attr("d", path);

        svg.append("g")
                .attr("class", "counties")
                .selectAll("path")
                .data(topojson.feature(us, us.objects.counties).features)
                .enter().append("path")
                .attr("d", path)
                .style("fill", function(d){return color_scale2(counties_data[0][d.id]);});

        svg.append("g")
                .attr("class", "states")
                .selectAll("path")
                .data(topojson.feature(us, us.objects.states).features)
                .enter().append("path")
                .attr("d", path);

        var legend = svg.selectAll('g.legendEntry')
                .data(color_scale2.range().reverse())
                .enter()
                .append('g')
                .attr('class', 'legendEntry')
                .attr("transform", function(d, i) { return "translate(" + 820  + "," + (100 + (i * 15)) + ")"; });

        legend
                .append('rect')
                .attr("x", width - 910)
                .attr("y", function(d, i) {
                    return i * 20;
                })
                .attr("width", 10)
                .attr("height", 10)
                .style("stroke", "black")
                .style("stroke-width", 1)
                .style("fill", function(d){return d;});

        legend
                .append('text')
                .attr("x", width - 895) //leave 5 pixel space after the <rect>
                .attr("y", function(d, i) {
                    return i * 20;
                })
                .attr("dy", "0.8em") //place text one line *below* the x,y point
                .text(function(d,i) {
                    var extent = color_scale2.invertExtent(d);
                    return Math.round(extent[0]) + " - " + Math.round(extent[1]);
                });
    }
